_source.templateSource:
{{! Handlebars table template example}}

{{#if config.templateVars.hidden}}
{{else}}
  {{#if config.open}}
    <span class="snippetLabel">{{config.templateVars.label}}</span>
    <a href="javascript:showHide('{{id}}');" id="button-{{id}}" class="snippetShowHideButton" style="font-size:12px;">- Hide</a> 
    <span> ({{results.bindings.length}})</span>
    <div id="cont-{{id}}"  style="display: block;">
  {{else}}
    <span class="snippetLabel">{{config.templateVars.label}}</span>
    <a href="javascript:showHide('{{id}}');" id="button-{{id}}" class="snippetShowHideButton" style="font-size:12px;"> + Show</a> 
    <span> ({{results.bindings.length}})</span>
    <div id="cont-{{id}}"  style="display: none;">
  {{/if}}
  <style>
    table.custom-header th {color:black;}
  </style>
  <table class="table table-condensed custom-header">
      <thead>
      <tr>
          {{#each head.vars}}
              <th>{{this}}</th>
          {{/each}}
      </tr>
      </thead>
      <tbody>
      {{#each results.bindings}}
      <tr>
          {{#each ../head.vars}}

            {{!-- 
                  to handle "this" correctly a custom helper is available  
                  "../this" is a reference to the binding
                  while "this" contains the variable name
            --}}

            {{#getVariableValue ../this this "uri" }}
              <td>
                <a href="{{value}}">{{label}}</a>
              </td>
            {{else}}
              <td>
                {{value}}
              </td>
            {{/getVariableValue}}
          {{/each}}
      </tr>
      {{/each}}
      </tbody>
  </table>
  <br/>
  <br/>
  <script>
    // here is how to pass the results  
    var x = {{{json results}}};
    // console.log(x);

   function showHide(id){
    var buttonEl = document.getElementById('button-' + id);
    var contEl = document.getElementById('cont-' + id);
    var style = window.getComputedStyle(contEl);

    if (style.display == 'none') {
      contEl.style.display = 'block';
      buttonEl.innerHTML = '- Hide';
    } else {
      buttonEl.innerHTML = '+ Show';
      contEl.style.display = 'none';
    }
  }
<{{!}}/script>
  </div>
{{/if}}

//- Jade generic table template example

- var display    = (config.open === true ? 'block' : 'none')
- var buttonText = (config.open === true ? '- Hide' : '+ Show')

style.
 thead.custome-header thead{color:#black;}

a(href="javascript:showHide('#{id}');", id="button-#{id}", class="snippetShowHideButton") #{buttonText} 
span= ' '
span(class="snippetLabel")= config.templateVars.label
span=  ' ('+results.bindings.length +') '
div(id="cont-#{id}", style={display: display})
  if results.bindings.length == 0
    div(class="table-vis-error") 
      h2
        i(class="fa fa-meh-o")
      h4 No results found
  else
    table(class='table table-condensed custome-header')
      thead
        tr
          each val in head.vars
            th= val
      tbody
        each binding in results.bindings
          tr
            each varName in head.vars
              if binding[varName]
                if binding[varName].type == "uri"
                  td
                    a(href="#{binding[varName].value}") #{binding[varName].label}
                else
                  td= binding[varName].value
              else
                td
script(type='text/javascript').
  function showHide(id){
    var buttonEl = document.getElementById('button-' + id);
    var contEl = document.getElementById('cont-' + id);
    var style = window.getComputedStyle(contEl);

    if (style.display == 'none') {
      contEl.style.display = 'block';
      buttonEl.innerHTML = '- Hide';
    } else {
      buttonEl.innerHTML = '+ Show';
      contEl.style.display = 'none';
    }
  }
  var x = !{JSON.stringify(results)};

//- The data passed to the template has the following format
//- {
//-   id: STRING, // a unique random id
//-   results: {...}, // data returned by the query
//-   config: {},     // query configuration
//-   
//- }
//-
//- Data returned by the query is assigned
//- to the **results** property 
//- and can be used inside the template.

pre(id=id)= empty
script(type='text/javascript').
  var id = '!{id}';
  var x = !{JSON.stringify(results)};
  var el = document.getElementById(id);
  el.innerHTML = JSON.stringify(x, null, ' ');
